import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';

class App extends Component {
  render(){

    return(
      <div class="row">
        <div class="col">
          <Header/>

        <Content/>
        </div>
      </div>
    );
  }
}
class Header extends Component{
  render(){
    return(
      <div>
        <h2>this is a web</h2>
      </div>
    );
  }
}

class Content extends Component{
  render(){
    return(
      <div>
        <h3>this is not a program</h3>
      </div>
    );
  }
}


export default App;
